import AsyncStorage from "@react-native-async-storage/async-storage";
import storage from "../utils/storage";

const getCategories = () => new Promise(resolve => {
    storage.get("categories")
        .then(res => resolve(res ? JSON.parse(res) : []));
});

export {
    getCategories
}
